cp.ThreeDSlide = function (el, args) {
    "use strict";
    cp.ThreeDSlide.baseConstructor.call(this, el);
    this.prefix = '3DFrame_'
    this.visible = 1;
    this.prevFrame = -1;
    this.itemData = cp.D[el.parentElement.id];
    cp.cp3DSlideInstance = this;
    this.reload = true;
}

cp.inherits(cp.ThreeDSlide, cp.DisplayObject);

cp.ThreeDSlide.prototype.loadSlide = function () {
    var hotspotArray = [];
    var textItemArray = [];
     if (this.itemData) {
        this.itemData.si.forEach(item => {
            /**
             * All the items on a threeD slide will ultimately be drawn as meshes on the three D scene. 
             * Handling hotspots here as of now. Handle other items here later...
             */
            var item = cp.D[item.n];
            if(item.type == 684){
            if( !item.hpImgPath )
                return;
            hotspotArray.push({
                uid: 12,
                geometryType: item.geometryType,
                //Pass copy of array to the function. Otherwise, the original values in cp.D are modified and on revisiting the slide, the hotspots are not seen.
                values: Object.assign([], item.values),
                name: cp.D[item.mdi].dn,
                pauseFrame: cp.D[cp.D[item.mdi].dn].pa,
                fileId: cp.movie.im.images[item.hpImgPath] ? cp.movie.im.images[item.hpImgPath].nativeImage.src : item.hpImgPath,
            });
        }else if(item.type == 689){
            textItemArray.push({
                uid:item.uid,
                values: Object.assign([], item.values),
                name:  cp.D[item.mdi].dn,
                style: Object.assign({}, item.style),
                text: item.text
            });
        }
        });
    }
    var slideInfo = {fileId:'',hotspot: hotspotArray, textItem:textItemArray, type : 0, cameraTarget: []};
    var slideCanvasData = cp.D[this.itemData.mdi];
    var fileSource ;
    var type = 0;
    if(slideCanvasData.resType == 'image') {
        slideInfo.fileId = cp.movie.im.images[slideCanvasData.ip].nativeImage.src;
    } else {
        slideInfo.fileId = slideCanvasData.bgVideo;
        slideInfo.type = 1;
    }
    slideInfo.cameraTarget = this.itemData.cameraTarget;
    cp.ThreeDSlide.m_threeDMain.updateWindowedSlide(slideInfo);
}

cp.ThreeDSlide.prototype.start = function (iForce, iReasonForDrawing) {
    this.drawIfNeeded(iForce, iReasonForDrawing);
    if (!this.effectIsStarted || iForce) {
        this.updateEffects(this.hasEffect);
        this.effectIsStarted = true;
    }
}


cp.ThreeDSlide.prototype.onEnterFrame = function () {
    if (cp.ThreeDSlide.m_threeDMain) {
        cp.ThreeDSlide.m_threeDMain.updateFrame(cpInfoCurrentFrame);
    }
}

cp.ThreeDSlide.prototype.updateFrame = function () {
    // if (this.m_threeDMain) {
    //     this.m_threeDMain.updateFrame(cpInfoCurrentFrame);
    // }
}

cp.ThreeDSlide.prototype.render = function () {
    THREE.VRController.update();

    if (window.controller_1) {
        var quaternion = new THREE.Quaternion()
        window.pointer.applyQuaternion(quaternion);
        window.pointer.quaternion.copy(window.controller_1.quaternion);

        var newPos = new THREE.Vector3();
        var cameraDirection = new THREE.Vector3(0, 0, -1);
        cameraDirection.applyQuaternion(window.pointer.quaternion);
        newPos.addVectors(window.pointer.position, cameraDirection.multiplyScalar(20));
        window.crossHair.position.copy(newPos);
    }

    // console.log(ThreeJSWrapper.rayInput.getRightDirection());
    //console.log(ThreeJSWrapper.rayInput.getDirection());
    //console.log(ThreeJSWrapper.camera.rotation);

    this.highlightHover();
    this.checkSelection();

    // Update the input system in a game loop.
    if (!controllerConnected) {
        var ua = navigator.userAgent.toLowerCase();
        var isAndroid = ua.indexOf("android") > -1; //&& ua.indexOf("mobile");
        if (isAndroid) {
            if (ThreeJSWrapper.camera.rotation.x < -0.7) {
                ThreeJSWrapper.showButtons();
            } else if (ThreeJSWrapper.camera.rotation.x > -0.2) {
                ThreeJSWrapper.hideButtons();
            }
        }
    }

    for (var i = 0; i < ThreeJSWrapper.hotspots.length; i++) {
        ThreeJSWrapper.hotspots[i].lookAt(ThreeJSWrapper.camera.position);
    }
    //ThreeJSWrapper.rayInput.update();
    ThreeJSWrapper.renderer.render(ThreeJSWrapper.scene, ThreeJSWrapper.camera);
    // ThreeJSWrapper.group.rotation.y += 0.025;
    if (cp.__step)
        cp.__step();
}


cp.ThreeDSlide.prototype.reset = function (endOfSlide) {
    delete cp.ropMap[this.element.id];
    // release memory
    this.isDrawn = false;
    this.element.width = "0";
    this.element.height = "0";
    this.element.style.width = "0px";
    this.element.style.height = "0px";

    this.element.left = "0";
    this.element.top = "0";
    this.element.style.left = "0px";
    this.element.style.top = "0px";
    this.effectIsStarted = false;
}

cp.ThreeDSlide.prototype.drawIfNeeded = function (iResponsiveForce, iReasonForDrawing) {
    if (this.drawForResponsive(iResponsiveForce, iReasonForDrawing))
        return;
    if (this.isDrawn)
        return;
}

cp.ThreeDSlide.prototype.drawForResponsive = function (iForce, iReason) {
    //In case of ThreeDSlide, drawForResponsive would be called for Blank, Responsive and VR Proje
    if (this.isDrawn && !iForce)
        return true;

    if (!cp.ThreeDSlide.m_threeDMain || (!cp.inVR && this.reload)) {
        cp.ThreeDSlide.m_threeDMain = new ThreeDMain(this.element);
        this.loadSlide();
        cp.shouldAnimate = false;
        this.reload = false;
    } else if(cp.inVR && this.reload){
         this.loadSlide();
         this.reload = false;    
    }
    return true;
}
